import React from 'react';

function Footer() {
  return (
    <footer className="bg-dark text-light py-4" fixed-bottom>
      <div className="container">
        <div className="row">
          <div className="col-md-12 text-center text-md-center mb-3 mb-md-0">
            <p className="mb-0">&copy; {new Date().getFullYear()} <strong>GURU AUTOMOBILE</strong> Repairing and Services</p>
          </div>
        </div>
        </div>
    </footer>
  );
}

export default Footer;
